    useEffect(() => {
        fetchJsonp(
            "https://kayak.com/h/mobileapis/directory/airlines/homework.api",
            {
                jsonpCallback: "jsonp",
            }
        )
            .then((res) => res.json())
            .then((data) => console.log(data));
    });
    return (
        console.log(),
        (
            <div>
                <Header />
            </div>
        )
    );
}

export default App;
